import Calender from "../../icons/Calender";

export default function TopTitle({ title, date, category }) {
    return (
        <div class="px-4">
            <p class="text-left text-3xl font-bold mt-10 mb-5">
                {title}
            </p>
            <div class="flex">
                <div class="flex items-center mr-10">
                    {Calender}
                    <span class="ml-2 leading-none">{date}</span>
                </div>
                <div class="flex items-center">
                    <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="#000000" strokeWidth="1.5" strokeLinecap="square" strokeLinejoin="round">
                        <path d="M20.59 13.41l-7.17 7.17a2 2 0 0 1-2.83 0L2 12V2h10l8.59 8.59a2 2 0 0 1 0 2.82z"></path>
                        <line x1="7" y1="7" x2="7.01" y2="7"></line>
                    </svg>
                    <span class="ml-2 leading-none">{category}</span>
                </div>
            </div>
        </div>
    );
}
